import React, {useState} from 'react';
import './App.css';

//components
import Toolbar from '../src/components/Toolbar/Toolbar'
import SideDrawer from './components/SideDrawer/SideDrawer';
import Backdrop from './components/Backdrop/Backdrop';
import Botnav from './components/Botnavbar/Botnav'

function App() {

  const [sideDrawerOpened, setSideDrawer] = useState(false);

  return (
    <div className="App">
      <Toolbar click={(prevState) => setSideDrawer(!sideDrawerOpened)}/>
      <SideDrawer sideDrawerOpened={sideDrawerOpened}/>
      {sideDrawerOpened ? <Backdrop/> : null}


      {/* copipasta */}

      <div classname="container">
        <div id="marketing" classname="section">
          <div classname="content">
            <h1>Marketing</h1>
          </div>
          <div classname="overlay"></div>
            </div>
            <div id="technology" classname="section">
              <div classname="content">
                <h1>Technology</h1>
                </div>
                <div classname="overlay"></div>
                </div>
                <div id="advertising" classname="section">
                  <div classname="content">
                    <h1>Advertising</h1>
                    </div>
                    <div classname="overlay"></div>
                  </div>
        </div>



    </div>
  );
}

export default App;
